import React from "react";
import { Helmet } from "react-helmet";
import { Text } from "../../components/Text/Text.jsx";
import Header from "../../components/Header/Header.jsx";

export default function NosavedPage() {
    return (
        <>
            <Helmet>
                <title>DhiWise web app</title>
                <meta name="description" content="Web site created using create-react-app" />
            </Helmet>
            <div className="w-full bg-indigo-300 pb-[486px] md:pb-5">
                <div className="flex flex-col items-center">
                    <Header className="items-center p-[19px]" />
                    <Text size="xl" as="p" className="ml-[336px] mt-[330px] self-start !text-indigo-300_01 md:ml-0">
                        Email
                    </Text>
                    <Text size="xl" as="p">
                        You haven&apos;t saved anything yet!
                    </Text>
                </div>
            </div>
        </>
    );
}
